import React, { Component } from 'react';
import logo from '../img/logo2.png';

export default class Logo extends Component {
  render() {
    return (
      <>
        <img
          className="background-depth"
          src="data:image/gif;base64,"
        />
        <img
          className="background-depth2"
          src="data:image/gif;base64,"
        />
        <img
          className="background-depth3"
          src="data:image/gif;base64,"
        />
        <div id="logodiv">
          {/* <img className="glitch1" data-text="GLITCH" src={logo} /> */}
          <div className="glitch" data-text="GLITCH">
            GLITCH
          </div>
        </div>
      </>
    );
  }
}
